# Get number format from automation
number_format = inputs['number_format']

# Convert Bytes to Megabytes
def bytes_to_MB(number_in_Bytes):

	# Calculate size in MB with two decimal places
    size_in_mb = round(number_in_Bytes / (1024 * 1024), 2)
    return size_in_mb

# Formats a number with commas as thousands separators, rounded to 2 decimal places
def format_with_commas(number):
    """
    Returns:
        str: The formatted number as a string.
    """
    if isinstance(number, (int)):
        number = f"{number:,}"
    elif isinstance(number, (float)):
        number = f"{number:,.2f}"
    else:
        number = number
    
    if number_format == 'de':
        return number.replace(",", "X").replace(".", ",").replace("X", ".")
    else:
        return number
        

  
