# Convert app information into html
def app_info_to_html(json_data):
  
    # Parse the JSON data
    data = json_data

    included_attributes = {
        "name": "Name",
        "description": "Description",
        "id": "ID",
        "_resourcetype": "Resource Type",
        "usage": "Usage",
        "owner": "Owner",
        "published": "Published",
        "publishTime": "Publish Time",
        "spaceId": "Space ID",
        "hasSectionAccess": "Has Section Access",
        "encrypted": "Is encrypted",
        "createdDate": "Created Date",
        "modifiedDate": "Modified Date",
        "lastReloadTime": "Last Reload Time",
    }
    
    # Extracting info attributes
    attributes = data.get('info', {}).get('attributes', {})
    metadata = data.get('metadata', {})
    app_name = attributes.get('name', '')
    
    # Start building the HTML
    html_list_items = ''

    # Iterate through included attributes and add them to the description list
    for key, label in included_attributes.items():
        if key in attributes:
            value = attributes[key] if key not in ("createdDate", "modifiedDate", "lastReloadTime") else datetime.strptime(attributes[key], "%Y-%m-%dT%H:%M:%S.%fZ").strftime("%d.%m.%Y %H:%M:%S %Z")
            html_list_items += f'''
                                            <div class="c-description-list__group">
                                                <dt class="c-description-list__term" style="font-weight: bold;">
                                                    {label}:
                                                </dt>
                                                <dd class="c-description-list__detail">
                                                    <span class="c-description-list__term">
                                                        {value}
                                                    </span>
                                                </dd>
                                            </div>'''
                    
    # Calculate the App Memory Footprint in MB and add it to the list
    app_size_bytes = metadata.get('static_byte_size', 0)
    app_size_mb = bytes_to_MB(app_size_bytes)
    html_list_items += f'''
    	                                    <div class="c-description-list__group">
    	                                        <dt class="c-description-list__term" style="font-weight: bold;">
    	                                            App Memory Footprint:
    	                                        </dt>
    	                                        <dd class="c-description-list__detail">
    	                                            <span class="c-description-list__term">
    	                                                {format_with_commas(app_size_mb)} MB
    	                                            </span>
    	                                        </dd>
    	                                    </div>'''
    
    # Calculate the App Reload Peak RAM in MB and add it to the list
    app_reload_size_bytes = metadata.get('reload_meta', {}).get('peak_memory_bytes', 0)
    app_reload_size_mb = bytes_to_MB(app_reload_size_bytes)
    html_list_items += f'''
    	                                    <div class="c-description-list__group">
    	                                        <dt class="c-description-list__term" style="font-weight: bold;">
    	                                            App Reload Peak RAM:
    	                                        </dt>
    	                                        <dd class="c-description-list__detail">
    	                                            <span class="c-description-list__term">
    	                                                {format_with_commas(app_reload_size_mb)} MB
    	                                            </span>
    	                                        </dd>
    	                                    </div>'''
            
  	# Combine HTML list items into a complete HTML list
    app_info_html = f'''
                                        <dl style="margin: 30px 20px;" class="card-content c-description-list c-description-list--horizontal c-description-list--terms-short">
                                            {html_list_items}
                                        </dl>'''
    return app_info_html, app_name


# Convert data model information into html
def data_model_to_html(json_data):
  
    # Parse the JSON data
    data = json_data

    # Extract tables information
    tables = data.get('metadata', {}).get('tables', [])

    # Define the included attributes
    included_table_attributes_left = {
        "no_of_rows": "Number of Rows",
        "no_of_fields": "Number of Fields",
        "no_of_key_fields": "Number of Key Fields"
    }

    included_table_attributes_right = {
        "is_loose": "Is Loose",
        "comment": "Comment"
    }

    included_field_attributes = {
        "name": "Field Name",
        "cardinal": "Distinct Values",
        "total_count": "Non-Null Values"
    }

    # Initialize HTML
    data_model_html = ''

    # Iterate through tables
    for table in tables:
        if not table.get('is_system'):
            
            # Get table name
            table_name = table.get('name')

            # Extracting attribute values
            table_attributes = table.keys()

            # Initiate html list items
            html_list_items = ''

            # html part containing title
            html_list_items += f'''
                                <div class="card">
                                    <div class="col-12" style="padding-left: 40px; padding-bottom:20px;">
                                        <div class="title-grey-bg">
                                            <h3>{table_name} <p style="display: contents;">(table)</p></h3>
                                        </div>
                                    </div>
                                    <div class="col-6">
                                        <div class="card-content" style="padding: 0px 0px 0px 40px;">
                                            <dl style="margin: 30px 0px 30px 20px;" class="c-description-list  c-description-list--horizontal c-description-list--terms-short">'''

            # Iterate through included attributes for left pannel and add them to the description list
            for key, label in included_table_attributes_left.items():                
                if key in table_attributes:
                    value = table[key]
                    html_list_items += f'''
                                                <div class="c-description-list__group">
                                                    <dt class="c-description-list__term" style="font-weight: bold;">
                                                        {label}:
                                                    </dt>
                                                    <dd class="c-description-list__detail">
                                                        <span class="c-description-list__term">
                                                            {format_with_commas(value) if value != '' else '<br>'}
                                                        </span>
                                                    </dd>
                                                </div>'''
                    
            # html part containing bridge part to right pannel
            html_list_items += f'''
                                            </dl>
                                        </div>
                                    </div>
                                    <div class="col-6">
                                        <div class="card-content" style="padding: 0px 40px 0px 0px;">
                                            <dl style="margin: 30px 0px 30px 20px;" class="c-description-list  c-description-list--horizontal c-description-list--terms-short">'''
            
            # Iterate through included attributes for right pannel and add them to the description list
            for key, label in included_table_attributes_right.items():                
                if key in table_attributes:
                    value = table[key]
                    html_list_items += f'''
                                                <div class="c-description-list__group">
                                                    <dt class="c-description-list__term" style="font-weight: bold;">
                                                        {label}:
                                                    </dt>
                                                    <dd class="c-description-list__detail">
                                                        <span class="c-description-list__term">
                                                            {value if value != '' else '<br>'}
                                                        </span>
                                                    </dd>
                                                </div>'''
			
            # Calculate the App size in MB and add it to the list
            table_size_bytes = table['byte_size']
            table_size_mb = bytes_to_MB(table_size_bytes)
            html_list_items += f'''
                                                <div class="c-description-list__group">
                                                    <dt class="c-description-list__term" style="font-weight: bold;">
                                                        Table Size:
                                                    </dt>
                                                    <dd class="c-description-list__detail">
                                                        <span class="c-description-list__term">
                                                            {format_with_commas(table_size_mb)} MB
                                                        </span>
                                                    </dd>
                                                </div>'''
            
            # Combine HTML list items into a complete HTML list
            html_list = f'''
                    {html_list_items}
                                            </dl>
                                        </div>
                                    </div>'''
            
            # Get fields for the current table
            fields = data.get('metadata', {}).get('fields', [])
            table_fields = [field for field in fields if table_name in field.get('src_tables', [])]

            # Sort fields by whether they are key fields or not
            key_fields = [field for field in table_fields if "$key" in field.get('tags', [])]
            other_fields = [field for field in table_fields if field not in key_fields]

            # Create the table for fields
            html_table_head = ''
            html_table_rows = ''

            html_table_head += f'''
                                                        <th scope="col" class="HeadI--">Field Name</th>
                                                        <th scope="col" class="HeadI--">Distinct Values</th>
                                                        <th scope="col" class="HeadI--">Non-Null Values</th>
                                                        <th scope="col" class="HeadI--">Tags</th>
                                                        <th scope="col" class="HeadI--">Is Hidden</th>
                                                        <th scope="col" class="HeadI--">Is Key</th>
                                                        <th scope="col" class="HeadG--">Connected Tables</th>'''

            # Add key fields first
            for field in key_fields:
                is_key = "Yes"
                is_hidden = "Yes" if '$hidden' in field['tags'] else "No"
                tags = "<br>".join(tag[1:] for tag in field['tags'] if tag[0] == '$')
                connected_tables = "<br>".join(tab for tab in field['src_tables'] if tab != table_name)
                field_name = field['name']
                distinct_values = field['cardinal']
                non_null_values = field['total_count']
                html_table_rows += '<tr>'
                html_table_rows += f'''
                                                        <td class="BodyI--"><span class="statement">{field_name}</span></td>
                                                        <td class="BodyI--">{format_with_commas(distinct_values)}</td>
                                                        <td class="BodyI--">{format_with_commas(non_null_values)}</td>
                                                        <td class="BodyI--">{tags}</td>
                                                        <td class="BodyI--">{is_hidden}</td>
                                                        <td class="BodyI--">{is_key}</td>
                                                        <td class="BodyG--">{connected_tables}</td>
                                                    </tr>'''

            # Add other fields afterwards
            for field in other_fields:
                is_key = "No"
                is_hidden = "Yes" if '$hidden' in field['tags'] else "No"
                tags = "<br>".join(tag[1:] for tag in field['tags'] if tag[0] == '$')
                connected_tables = "<br>".join(tab for tab in field['src_tables'] if tab != table_name)
                field_name = field['name']
                distinct_values = field['cardinal']
                non_null_values = field['total_count']
                html_table_rows += '<tr>'
                html_table_rows += f'''
                                                        <td class="BodyI--"><span class="statement">{field_name}</span></td>
                                                        <td class="BodyI--">{format_with_commas(distinct_values)}</td>
                                                        <td class="BodyI--">{format_with_commas(non_null_values)}</td>
                                                        <td class="BodyI--">{tags}</td>
                                                        <td class="BodyI--">{is_hidden}</td>
                                                        <td class="BodyI--">{is_key}</td>
                                                        <td class="BodyG--">{connected_tables}</td>
                                                    </tr>'''

            # Combine HTML table rows into a complete HTML table with Bootstrap classes
            data_model_html += f'''
            {html_list}
                                    <div class="card-content" style="padding: 0px 40px 20px;">
                                        <div class="table-wrapper">
                                            <table class="TableStyle-tableGrid" cellspacing="0">
                                                <colgroup>
                                                    <col>
                                                    <col>
                                                    <col>
                                                    <col>
                                                    <col>
                                                    <col>
                                                    <col>
                                                </colgroup>
                                                <thead>
                                                    <tr>{html_table_head}</tr>
                                                </thead>
                                                <tbody>
                                                    {html_table_rows}
                                                </tbody>
                                            </table>
                                        </div>
                                    </div>
                                </div>
                                <br>'''
    
    return data_model_html


