# Convert script into html
def script_to_html(script_str):

    # Divide script into sections 
    sections = re.split(r'///\$tab\s', script_str)
    
    # Create HTML for script
    script_html = ''

    # Iterate over the sections
    for section in sections[1:]:
        section_split = section.split('\n')
        section_title = section_split[0].strip()

        script_html += f'''
                            <div class="card snow">
                                <div class="card-content card-code">
                                    <h3>{section_title} <p style="display: contents;">(script section)</p></h3>
                                <div>'''
        
        content_html = '''
                                        <pre>
                                            <code>
'''
        for line in section_split[1:]:
            content_html += '&nbsp;' + line.replace('<', '&lt;').replace('>', '&gt;')
        
        # Remove all trainling <br> tags
        content_html = content_html.rstrip('<br>&nbsp;')
        content_html = content_html.rstrip('<br>')
        content_html += f'''
                                            </code>
                                        </pre>
                                    </div>
                                </div>
                            </div>
                            <br>'''

        script_html += content_html

    return script_html


